import Note from "./Note"

import CardDeck from 'react-bootstrap/CardDeck'

const Project = props => {
    const notes = props.notes;
    return (
            <CardDeck className = {container-md}>{
                Object.keys(notes).map((note,i) =>
                    <Note key={i} type={notes[note].type} text={notes[note].text} title={notes[note].title} url={notes[note].url}/>
                )
            }
            </CardDeck>)
}




export default Project;
